import React from "react";
import { Link } from "react-router-dom";

const Nav = () => {
  return (
    <div>
      <h2>Componente Nav</h2>
      <h1>
        <Link to="/home">Let's start!</Link>
      </h1>
    </div>
  );
};

export default Nav;
